import React from 'react'
import HTML from '../assets/html.png';
import CSS from '../assets/css.png';
import JavaScript from '../assets/javascript.png';
import ReactImg from '../assets/react.png';
import Node from '../assets/node.png';
import FireBase from '../assets/firebase.png';
import GitHub from '../assets/github.png';
import Tailwind from '../assets/tailwind.png';
import Mongo from '../assets/mongo.png';

export const Skills = () => {
  return (
    <div className='w-full h-screen bg-black text-[#ffffff] '>
        <div className='grid grid-cols-4 border-2 gap-5 ' >
            <div className='flex flex-col items-center justify-center gap-4' ><img className='w-[100px] h-[100px]' src={HTML} alt="" />HTML</div>
            <div><img src={ReactImg} alt="" /></div>
            <div><img src={JavaScript} alt="" /></div>
            <div><img src={CSS} alt="" /></div>
        </div>
        <br/>
        <div className='grid grid-cols-4 border-2 gap-5' >
            <div><img src={Node} alt="" /></div>
            <div><img src={FireBase} alt="" /></div>
            <div><img src={GitHub} alt="" /></div>
            <div><img src={Tailwind} alt="" /></div>
        </div>
    </div>
  )
}
